export default function CancionItem() {
    return (
        <Box position="relative" w="100%">
            <Card h="10vh" w="100%" minWidth="205px" minHeight="360px" borderRadius="35px">
                <Heading size="2xl">Hola</Heading>
            </Card>
        </Box>
    );
}
